import React from "react";
import { FaGithub, FaTwitter } from "react-icons/fa";

const Home = () => {
  return (
    <section
      className="
  homepage"
    >
      <div className="over">
        <h1>Dillesha Lakshan</h1>
        <p> frontend web developer</p>
        <ul>
          <li>
            <a href="www.twitter.com" target="_blank">
              <FaTwitter />
            </a>
          </li>
          <li>
            <a href="www.github.com">
              <FaGithub />
            </a>
          </li>
        </ul>
      </div>
    </section>
  );
};

export default Home;
